import React, { useState } from "react";
import livecasinoimage from "../../assets/livecasiono.jpg";
import lllogo1 from '../../assets/lllogo1.jpg';
import lllogo2 from '../../assets/lllogo2.jpg';
import lllogo3 from '../../assets/lllogo3.jpg';
import lllogo4 from '../../assets/lllogo4.jpg';
import lllogo5 from '../../assets/lllogo5.jpg';
import lllogo6 from '../../assets/lllogo6.jpg';
import lllogo7 from '../../assets/lllogo7.jpg';
import lllogo8 from '../../assets/lllogo8.jpg';
import lllogo9 from '../../assets/lllogo9.jpg';
import lllogo10 from '../../assets/lllogo10.jpg';
import lllogo11 from '../../assets/lllogo11.jpg';
import lllogo12 from '../../assets/lllogo12.jpg';
import lllogo13 from '../../assets/lllogo13.jpg';
import lllogo14 from '../../assets/lllogo14.jpg';
import lllogo15 from '../../assets/lllogo15.jpg';
import lllogo16 from '../../assets/lllogo16.jpg';
import lllogo17 from '../../assets/lllogo17.jpg';
import lllogo18 from '../../assets/lllogo18.jpg';
import lllogo19 from '../../assets/lllogo19.jpg';
import lllogo20 from '../../assets/lllogo20.jpg';
import lllogo21 from '../../assets/lllogo21.jpg';
import lllogo22 from '../../assets/lllogo22.jpg';
import lllogo23 from '../../assets/lllogo23.jpg';
import lllogo24 from '../../assets/lllogo24.jpg';
import lllogo25 from '../../assets/lllogo25.jpg';
import lllogo26 from '../../assets/lllogo26.jpg';
import lllogo27 from '../../assets/lllogo27.jpg';
import lllogo28 from '../../assets/lllogo28.jpg';
import lllogo29 from '../../assets/lllogo29.jpg';
import lllogo30 from '../../assets/lllogo30.jpg';
import lllogo31 from '../../assets/lllogo31.jpg';
import lllogo32 from '../../assets/lllogo32.jpg';
import lllogo33 from '../../assets/lllogo33.jpg';
import lllogo34 from '../../assets/lllogo34.jpg';
import lllogo35 from '../../assets/lllogo35.jpg';
import lllogo36 from '../../assets/lllogo36.jpg';
import lllogo37 from '../../assets/lllogo37.jpg';
import lllogo38 from '../../assets/lllogo38.jpg';
import lllogo39 from '../../assets/lllogo39.jpg';
import lllogo40 from '../../assets/lllogo40.jpg';
import hoticon from '../../assets/game-icon-hot-mobile.svg';
import newicon from '../../assets/game-icon-new-mobile.svg';

const images = [
  { src: lllogo1, alt: " Image 1" },
  { src: lllogo1, alt: "Betswiz Image 2" },
  { src:lllogo1, alt: "Betswiz Image 3" },
  { src: lllogo1, alt: "Betswiz Image 4" },
  { src: lllogo1, alt: "Betswiz Image 5" },
  { src: lllogo1, alt: "Betswiz Image 6" },
  { src: lllogo1, alt: "Betswiz Image 7" },
  { src: lllogo1, alt: "Betswiz Image 8" },
  { src: lllogo1, alt: "Betswiz Image 9" },
  { src:lllogo1, alt: "Betswiz Image 10" },
  { src: lllogo1, alt: "Betswiz Image 11" },
  { src: betswizz, alt: "Betswiz Image 12" },
  { src: betswizz, alt: "Betswiz Image 13" },
  { src: betswizz, alt: "Betswiz Image 14" },
  { src: betswizz, alt: "Betswiz Image 15" },
  { src: betswizz, alt: "Betswiz Image 16" },
  { src: betswizz, alt: "Betswiz Image 17" },
  { src: betswizz, alt: "Betswiz Image 18" },
  { src: betswizz, alt: "Betswiz Image 19" },
  { src: livecasinoimage, alt: "Betswiz Image 20" },
];
const itemsPerPage = 10; // Number of images per page
const totalPages = Math.ceil(images.length / itemsPerPage);

const LiveCasino = () => {
  const [currentPage, setCurrentPage] = useState(1);

  // Get images for the current page
  const indexOfLastImage = currentPage * itemsPerPage;
  const indexOfFirstImage = indexOfLastImage - itemsPerPage;
  const currentImages = images.slice(indexOfFirstImage, indexOfLastImage);

  const handlePageChange = (page) => {
    if (page >= 1 && page <= totalPages) {
      setCurrentPage(page);
    }
  };

  return (
    <div>
      <div className="w-full min-w-full   bg-cover">
        <img
          src={livecasinoimage}
          alt="Live Casino"
          className="w-full h-full object-cover"
        />
      </div>

      <div className="flex flex-row items-center px-4 pt-4">
        <div>
          <svg
            xmlns="http://www.w3.org/2000/svg"
            className="h-6 w-6"
            viewBox="0 0 24 24"
            fill="currentColor"
          >
            <path
              fillRule="evenodd"
              d="M10 2a8 8 0 105.293 14.707l4.387 4.387a1 1 0 001.414-1.414l-4.387-4.387A8 8 0 0010 2zm-6 8a6 6 0 1112 0 6 6 0 01-12 0z"
              clipRule="evenodd"
            />
          </svg>
        </div>
        <div>
          <select className="shadow-2xl p-2 border border-black w-full outline-none max-w-4xl">
            <option value="" disabled selected>
              খেলা অনুসন্ধান করুন
            </option>
            <option value="exchange">exchange</option>
          </select>
        </div>
      </div>

      <div className="bg-common-blue mt-4 h-full p-2">
        <h3 className="bg-blue-800 shadow-3xl-blue flex items-center gap-2 p-3 rounded-lg">
          <div className="flex flex-row gap-4">
            <div className="flex gap-2 items-center">
              <input
                type="checkbox"
                id="betswiz"
                className="w-4 h-4 cursor-pointer"
              />
              <label htmlFor="betswiz" className="text-white font-medium">
                EVO
              </label>
            </div>
            <div className="flex gap-2 items-center">
              <input
                type="checkbox"
                id="betswiz"
                className="w-4 h-4 cursor-pointer"
              />
              <label htmlFor="betswiz" className="text-white font-medium">
                AP
              </label>
            </div>
            <div className="flex gap-2 items-center">
              <input
                type="checkbox"
                id="betswiz"
                className="w-4 h-4 cursor-pointer"
              />
              <label htmlFor="betswiz" className="text-white font-medium">
                AE
              </label>
            </div>
          </div>
        </h3>
      </div>

      <div className="grid  grid-cols-1 md:grid-cols-3 lg:grid-cols-5 px-4 flex-wrap pt-3  gap-4 justify-start">
        {currentImages.map((image, index) => (
          <div
            key={index}
            className="relative w-full h-auto bg-cover bg-center"
          >
            <figure>
              <div className="bg-black">
                <img
                  src={image.src}
                  alt={image.alt}
                  className="hover:bg-black w-full"
                />
                <div className="absolute inset-0 bg-black opacity-0 group-hover:opacity-50 transition duration-300"></div>
              </div>
              <button className="absolute inset-10 inset-x-20 flex items-center justify-center text-xs bg-common-orange text-white rounded-lg opacity-0 hover:opacity-100 transition-opacity duration-300">
                এখন খেলুন
              </button>
              <h3 className="absolute  bottom-0 left-0 bg-exchange-color text-white font-bold w-full shadow-exchange-shadow  text-center ">
              exchange
            </h3>
              {index < 10 ? (
                <button className="absolute top-0 right-0 flex items-center justify-center text-xs   rounded-lg p-2  transition-opacity duration-300">
                  <img src={hoticon} alt="" className="" />
                </button>
              ) : (
                <button className="absolute top-0 right-0 flex items-center justify-center text-xs  rounded-lg p-2  transition-opacity duration-300">
                 <img src={newicon} alt="" />
                </button>
              )}
            </figure>
          </div>
        ))}
      </div>

      <div className="flex justify-center items-center my-4">
        <button
          onClick={() => handlePageChange(currentPage - 1)}
          disabled={currentPage === 1}
          className="px-4 py-2 bg-white text-black font-bold border border-black rounded-md hover:bg-common-blue hover:text-white transition-all disabled:opacity-50"
        >
          Previous
        </button>

        <div className="flex items-center space-x-2 mx-4">
          {Array.from({ length: totalPages }, (_, index) => (
            <button
              key={index + 1}
              onClick={() => handlePageChange(index + 1)}
              className={`px-4 py-2 text-black border border-gray-300 rounded-md 
                ${
                  currentPage === index + 1
                    ? "bg-common-blue text-white"
                    : "bg-white hover:bg-common-blue hover:text-white"
                } 
                transition-all`}
            >
              {index + 1}
            </button>
          ))}
        </div>

        <button
          onClick={() => handlePageChange(currentPage + 1)}
          disabled={currentPage === totalPages}
          className="px-4 py-2 bg-white font-bold text-black border border-black rounded-md hover:bg-common-blue hover:text-white transition-all disabled:opacity-50"
        >
          Next
        </button>
      </div>
    </div>
  );
};

export default LiveCasino;
